    const editorRef = useRef();

  return (
    <Box>
        <Editor  height="75vh"
            theme="vs-dark"
 defaultLanguage="javascript" defaultValue="// some comment"
 value={value}
 onChange={(value) => setValue(value)} />
        
    </Box>
  )
}

